下地のカラーによってチェックの部分に変化が見られるように透け感があります。<br>


●絵柄ひとつひとつの周囲に精密なカットを施しています。<br>
●ピンセットなどで絵柄の端を持って台紙からゆっくりと丁寧にはがしてください。<br>
●台紙をそらしていただくと、よりはがしやすくなります。<br>
●素材は薄さ約８０ミクロンの特殊な透明フィルム。
　デリケートなネイルの曲線にしなやかにフィットします。<br>
●ネイルに貼る前に空気が入らないように、端からゆっくりと貼り付けてください。<br><br>

【注意事項】<br>

ジェルに埋め込む場合は、未硬化ジェルを拭き取ってから貼り、その上から再度ジェルコーティングしてください。<br>
未硬化ジェルがついたままのネイルに使用しますと、粘着力が弱く爪のカーブにフィットしません。
